Update multiple conditions array in MongoDB<p>I have this data :</p>
<pre class="lang-js prettyprint-override"><code>{
  'id': '1',
  'object': [
     {'code': 'a'},
     {'code': 'b'},
     {'code': 'c'}
  ]
}
</code></pre>
<p>And this query :</p>
<pre class="lang-js prettyprint-override"><code>db.test.update({
    'id': '1',
    'object': {
        '$elemMatch': {
            '$or': [
                {'code': 'b'},
                {'code': 'c'}
            ]
        }
    }
},
    {'$set':{'object.$.test':'ok'}}
)
</code></pre>
<p>Documents can contain one of these codes, both or none.<br />
It works well with documents with one condition fulfilled.</p>
<p>In the case if there are 2 codes in the document, only the first one is updated :<br />
I want to update both of them (code: 'b' AND code: 'c')</p>
<pre class="lang-js prettyprint-override"><code>{
  'id': '1',
  'object': [
     {'code': 'a', 'test': 'ok'},
     {'code': 'b'}
  ]
}
</code></pre>
<p>This is what I want :</p>
<pre class="lang-js prettyprint-override"><code>{
  'id': '1',
  'object': [
     {'code': 'a', 'test': 'ok'},
     {'code': 'b', 'test': 'ok'}
  ]
}
</code></pre>
<p>Thank you for helping.</p>

