Mongo aggregate match + group with sum - return 0 if no matches<p>See <a href="https://mongoplayground.net/p/Kxhuz-ZsN7G" rel="nofollow noreferrer">playground</a>. Here's the query:</p>
<pre><code>db.collection.aggregate([
  {
    $match: {
      time: {
        $gte: 20,
        $lte: 40
      }
    }
  },
  {
    $group: {
      _id: null,
      amount: {
        $sum: &quot;$amount&quot;
      }
    }
  },
  {
    $project: {
      _id: 0,
      amount: 1
    }
  }
])
</code></pre>
<p>If no match found, it just returns an empty array. I would like it to return <code>[{amount: 0}]</code> even if no match. How is it possible?</p>

