React Apollo client multiple mutations<p>I have a datasheet style table with list of records, that need updating their values. I would like to run a single Submit and in my GraphQL send an array of records as a single argument to the set query. They are actually MongoDB documents. As in the title I am using React with Apollo client. Thank you in advance :)</p>
<p>More details below</p>
<p>So I have this mutation on server side it works with Playground. However it gives errors on Apollo client side.</p>
<pre><code>mutation { updateWorklogs( input: [ { id: &quot;60c6b&quot;, week1: 1, week2: 2, week4: 9 }, { id: &quot;60c6c&quot;, week1: 3, week2: 4, week4: 1.5 } ] ) { id year month name } }
</code></pre>
<p>Apollo Client tools show the mutation variables correctly as</p>
<p><a href="https://i.stack.imgur.com/3bVUO.png" rel="nofollow noreferrer">tools showing</a></p>
<p>However in Apollo Client tools when I try to run the query it is showing as
{input:[{id:60c6b9ca277c815ec200992a,week1:5,week2:2,week3:0,week4:9},{id:60c6ba80277c815ec200992e,week1:0,week2:5,week3:0,week4:0}]}</p>
<p>which I guess is fine. This should work as it is identical to what I'm running in Playground, but not!</p>
<p>I tried to run JSON.parse(myVariables) but no help. Apollo seems to convert it. And final result the query doesnt run. It returns a 400 response, with not much else. If I need an interface I'm not using TS, no idea how to do it in React JS yet.</p>
<pre><code>const [setWorklog] = useMutation(SET_WORKLOGS);

const handleSubmit = (event) =&gt; {
    event.preventDefault();
    console.log(&quot;state=&quot;, state) // returns the above state, which is correct
    setWorklog({ variables: { input: state }, update(proxy, result) {
      const data = proxy.readQuery({
        query: GET_WORKLOGS
      })
      data.userWorklogs = result.data.setWorklogs;
      proxy.writeQuery({ query: GET_WORKLOGS, data });
    }}).then(
      console.log(&quot;returned=&quot;,data.updateWorklogs)
    )
    .catch(e =&gt; {
      console.log(&quot;Error=&quot;, e);
    })
  };
</code></pre>
<p>Thanks again</p>

