C# MongoDB, LINQ unable to match by Id<p>I'm using MongoDB.Driver (2.12.4) while trying to stay away from Bson documents. Apart from the Mongo collection methods I use LINQ for all of my queries.</p>
<p>I have a baseclass like this:</p>
<pre><code>public abstract class Entity
{
    public Guid Id { get; protected set; }
}
</code></pre>
<p>And a subclass like this:</p>
<pre><code>public class User : Entity
{
    public string Name { get; set; }
    public string Email { get; set; }
}

public User(string name = &quot;&quot;, string email = &quot;&quot;)
{
    Id = Guid.NewGuid();
    Name = name;
    Email = email;
}
</code></pre>
<p>And my database class is initialized like this:</p>
<pre><code>class Database
{
    const string MongoConnection = &quot;mongodb+srv://user:password@cluster0.mongodb.net/&quot;;
    public static MongoClient Client { get; private set; }
    public static IMongoDatabase Directory { get; private set; }
    public static IMongoCollection&lt;User&gt; Users { get; private set; }

    public Database()
    {
        BsonSerializer.RegisterSerializer(new GuidSerializer(GuidRepresentation.Standard));
        Client = new MongoClient(MongoConnection);
        Directory = Client.GetDatabase(&quot;DB&quot;);
        Users = Directory.GetCollection&lt;User&gt;(&quot;users&quot;);
    }
}
</code></pre>
<p>What has been working so far:</p>
<pre><code>Database.Users.InsertOne((new User(&quot;name&quot;, &quot;email@domain.com&quot;)); //cloud.mongodb.com shows {_id : UUID('a12937ba-7a7c-4c5d-a8ff-4049e9878ca3')}
var document = Database.Users.AsQueryable().Where(x =&gt; x.Email == &quot;email@domain.com&quot;).FirstOrDefault();
Database.Users.AsQueryable().ToList().Where(x =&gt; x.Id == document.Id).FirstOrDefault()
</code></pre>
<p>But none of the following is working:</p>
<pre><code>Database.Users.Find(x =&gt; x.Id == document.Id).FirstOrDefault(); //returns null
Database.Users.AsQueryable().Any(x =&gt; x.Id == document.Id); //returns false
Database.Users.ReplaceOne(x =&gt; x.Id == document.Id, document); //returns MatchedCount = 0
</code></pre>
<p>So it seems that as soon as I use .ToList then everything works as expected. But if I use .AsQueryable, .Find, .Any or .ReplaceOne directly on the collection then it's not able to perform a match between Ids.</p>
<p>I am not able to find a similar question that does not use [BsonId] or [BsonElement] and does not make use of filters and builders. If I understand correctly the MongoDB.Driver is supposed to do the mapping automatically, and for every property it works except the Id. What am I missing?</p>
<p>PS: I am not using Entity Framework</p>

