Unique key only in array of subschemas?<p>I have a schemas. One of its keys takes the type of an array of schemas.</p>
<pre><code>let instanceSchema = new Mongoose.Schema({
    name: { type: String, required: true, unique: true }
})

let mainSchema = new Mongoose.Schema({
    instances: { type: [instanceSchema], required: true }
})
</code></pre>
<p>So the <code>mainSchema</code> has a key that is an array of <code>instanceSchemas</code>. I want the behavior to be such that I can have <code>instanceSchemas</code> with the same name if they are members of different <code>mainSchemas</code>, like so:</p>
<pre><code>let MainModel = mongoose.model(&quot;MainModel&quot;, mainSchema);

// Succeeds
main1 = new MainModel({
    &quot;instances&quot;: [ {&quot;name&quot;: &quot;Instance1&quot;}, {&quot;name&quot;: &quot;Instance2&quot;} ];
});

// Succeeds
main2 = new MainModel({
    &quot;instances&quot;: [ {&quot;name&quot;: &quot;Instance1&quot;}, {&quot;name&quot;: &quot;Instance2&quot;} ];
});
</code></pre>
<p>As shown, we have two named &quot;Instance1&quot; and two named &quot;Instance2&quot; but they are members of different documents (main1 and main2) so my target behavior is that this should be allowed. However, using <code>unique</code> prevents this from happening as Mongoose checks all <code>instanceSchema</code> models. Is there a way to allow duplicates as long as they are members of different documents?</p>

